export default class Preload {
    constructor(api, pluginOptions) {
        this.api = api;
        this.pluginOptions = pluginOptions;
    }
    /**
     * 是否预加载视频，h5video专用
     */
    get() {
        return this.api.getPlayerOption('preload');
    }
    set(load) {
        return this.api.setPlayerOption('preload', load);
    }
}
